                "GeneralBoatDescription": [
                    "<p> 67' trawler yacht built by the Miller boat yard on Bainbridge Island Washington. She is designed by Ed Monk JR. and styled after the Malahide, Nordhavn, Romsdal, north sea trawler form. She is powered by twin Volvo diesels each turning there own props, with 3000 gals of fuel she is capable of making long voyages.  She is well laid out providing three cabins and three heads. Her well appointed galley features household appliances and allows the chef fantastic views while preparing meals. She has a Hurricane diesel furnace. She is stabilized by naiad hydraulic fins, new Northern Lights Gen set 35 hrs, full size washer and dryer, vacuflush head systems, full updated electronics, Complete rewire with panels, new plumbing. Hydraulic windlass, bow thruster. The pilothouse is beautifully finished in rich teak and allows a 360' view from the functional Stidd helm seat.  Her design allows for complete walk around side decks covered in teak. She is truly a gentleman's yacht which turns heads in every marina she visits</p>"
                ],
                "BoatClassCode": [
                    "Trawlers"
                ],
                "BoatClassCodeNoCaseAlnumOnly": [
                    "Trawlers"
                ],
                "AdditionalDetailDescription": [
                    "<strong>general</strong><br><ul> <li>Full replacement of electrical 12V, 24V, 120V and 220V systems with Blu Seas components.</li> <li>New start and house battery systems with new battery boxes.</li> <li>New Isolation transformer, battery charging system and inverters.</li> <li>New duplicate navigation electronics</li> <li>New Garmin radar system</li> <li>New electric Water heater 30 Gallon</li> <li>New 20 KW Northern Lights Gen Set</li> <li>New dual VHF radios and antennae</li> <li>New water pumps and distribution system with PLEX hose</li> <li>Redo of aft deck with removal of shrouds for aft mast and Add of new seating</li> <li>Replace cabinetry in main Salon with add of “pop-up” wide screen TV and full wireless internet connection</li> <li>Add Leather Sofa in Salon and in Pilot House</li> <li>New sound system in pilot house and aft deck</li> <li>Emergency High Volume evacuation pump with separate bilge connections throughout boat</li> <li>New engine room Halon “Fire Boy” fire retardant system</li> <li>New canvas throughout with enclosure of aft cockpit, tender cover, crew cabin housing and aft deck surround</li> </ul>",
                    "<strong>Disclaimer</strong><br>The Company offers the details of this vessel in good faith but cannot guarantee or warrant the accuracy of this information nor warrant the condition of the vessel. A buyer should instruct his agents, or his surveyors, to investigate such details as the buyer desires validated. This vessel is offered subject to prior sale, price change, or withdrawal without notice.",
                    "<strong>customContactInformation</strong><br><p><span style=\"color: #ff0000; font-size: medium;\">please call 206-940-9088 or</span></p> <p> </p> <p>uwhuskies00@hotmail.com</p> <p> </p>"
                ],
