                "GeneralBoatDescription": [
                    "<p style=\"text-align: center;\"><span style=\"color: rgb(52, 73, 94);\"><strong><span style=\"font-size: 14pt;\">\"OPHELIA\"<br />2022 Ranger Tug R-23</span></strong></span></p> <p style=\"text-align: left;\"><span style=\"color: rgb(52, 73, 94);\"><strong><span style=\"font-size: 14pt;\"><br /></span></strong></span><span style=\"color: rgb(52, 73, 94);\"><strong><span style=\"font-size: 14pt;\">Come get a good look at OPHELIA, a 2022 Ranger Tug R-23 in like-new condition with only 168 hours on her. </span></strong></span></p> <p style=\"text-align: left;\"><span style=\"color: rgb(52, 73, 94);\"><strong><span style=\"font-size: 14pt;\">Features include:<br />***Economical and dependable Yamaha F200XCA outboard power<br />***Side Power bow thruster, Garmin MFD (radar/plotter/sounder), Standard Horizon GX1850 VHF, cabin heat and Webasto AirTop forced air furnace<br />***Full galley with fridge, microwave, stovetop, sink (hot/cold water)</span></strong></span></p> <p style=\"text-align: left;\"><span style=\"color: rgb(52, 73, 94);\"><strong><span style=\"font-size: 14pt;\">***Cruise at 18kts, WOT at 30kts. 80 gallons fuel capacity<br />***Ground tackle including combo chain/nylon line rode, 12vdc Lewmar windlass<br />***Dual axle Float-On trailer</span></strong></span></p> <p style=\"text-align: left;\"><span style=\"color: rgb(52, 73, 94);\"><strong><span style=\"font-size: 14pt;\">This is just a short list of equipment on OPHELIA. In the typical Ranger Tug style, she is loaded with everything you would need to spend time on the Salish Sea in comfort and safety...and with the trailer, you can take her anywhere!</span></strong></span></p> <p style=\"text-align: left;\"><span style=\"color: rgb(52, 73, 94);\"><strong><span style=\"font-size: 14pt;\">Come get a look for yourself at this excellent Ranger Tugs R-23!</span></strong></span></p>"
                ],
                "BoatClassCode": [
                    "Trawlers",
                    "Pilothouse",
                    "Cruisers"
                ],
                "BoatClassCodeNoCaseAlnumOnly": [
                    "Trawlers",
                    "Pilothouse",
                    "Cruisers"
                ],
                "AdditionalDetailDescription": [
                    "<strong>Manufacturer Provided Description</strong><br><p>The popular Ranger Tugs R-23 is powered by a 200 HP Yamaha outboard. The first thing you will notice when looking at the new R-23 is the dramatic, curved windshield and visor, which is emphasized by several overhead skylights. There is no shortage of light or visibility onboard the R-23, which incorporates four opening roof hatches, sliding side windows, and an opening glass bulkhead, providing a very open and airy feeling inside and out. Opening portlights also allow for a nice cross breeze in the cabin.</p> <p>The forward cabin on the R-23 has plenty of room for sitting around the teak table, separate sleeping for two or sleeping two together with the filler-cushion. The mid berth is great for kids or storage, and the dinette converts to a sleeper as the third berth. The well-appointed galley on the R-23 is standard with refrigerator/freezer, cooktop, and microwave. The forward head includes a marine toilet with holding tank, shower, sink, and mirror. The Ranger Tugs R-23 is standard with Garmin 942xsv GPS chartplotter with sonar and is available with optional xHD radar. VHF to stay in touch, illuminated compass, cabin night light, cockpit and exterior side trail lighting, and our patented built-in safety trailering lights (brake, turn, and reverse) are all standard equipment making the R-23 ready to cruise. The cockpit on the R-23 is built to fish and ready to entertain with standard rod holders, optional downrigger pads & outlets, and a folding double seat.</p> <p>The R-23 is perfect for overnighting or extended cruises. It incorporates many of the same amenities as a larger cruising yacht that until now were not offered on a boat of her size and price point. Whether you are new to boating or a seasoned captain, the R-23 is the perfect boat for your next adventure.</p>",
                    "<strong>Performance</strong><br><ul> <li>200 HP Outboard</li> <li>Full engine instrumentation</li> <li>Laminar Flow Interrupters, increase turning performance (patented)</li> <li>Single lever, electronic shift and throttle control</li> <li>Trim tabs</li> </ul>",
                    "<strong>Features</strong><br><ul> <li>Bronze tinted solar skylight and side glass</li> <li>Chain and rode storage well</li> <li>Double wide, reversible companion seat</li> <li>Dual stereo, (4) speakers, Bluetooth, AM/FM, aux input</li> <li>Fuel flow data display</li> <li>Mid-berth with foam mattress</li> <li>Navigation package, Garmin 7610 GPS plotter, FF</li> <li>Rear opening glass bulkhead with reversible dinette seat</li> <li>Rod Holders</li> <li>Sports rack</li> <li>Swim platform w/S.S. ladder</li> </ul>",
                    "<strong>Convenience</strong><br><ul> <li>Aircraft style, L.E.D. indirect lighting</li> <li>Cockpit fold-out double seat</li> <li>Cockpit soft top extension</li> <li>Cook top, electric/alcohol</li> <li>Curtains and window covers for privacy</li> <li>Dinette, salon, seats (4), converts to bed, high/low table</li> <li>Hatches (2), forward stateroom, opening, translucent</li> <li>Hatches (2), salon roof, opening, translucent</li> <li>Marine head with holding tank and deck pump-out</li> <li>Microwave</li> <li>Outlets 110V (3)</li> <li>Outlets, 12V (2)</li> <li>Private head w/shower, S.S. sink and vanity</li> <li>Private stateroom with high/low table, converts to bed</li> <li>Refrigerator/freezer, 12V</li> <li>Silverware drawer</li> <li>Sinks (2), fresh water system w/demand pump, H and C</li> <li>Sunvisor</li> <li>Transom entry door for easy boarding</li> <li>USB port at helm</li> <li>Water tank level monitor (fresh)</li> <li>Windshield Wipers (2), pantographic</li> </ul>",
                    "<strong>Safety</strong><br><ul> <li>Bow rail</li> <li>Built-in trailer lights (patented)</li> <li>Co monitor 12V</li> <li>Handrails</li> <li>Horn</li> <li>Illuminated compass</li> <li>LED courtesy lights, cockpit entry step, swim step and walkways</li> <li>Navigation lights</li> <li>VHF radio w/antenna</li> </ul>",
                    "<strong>Construction</strong><br><ul> <li>Bonded electrical system</li> <li>Fiberglass cockpit liner, self-bailing w/non-skid</li> <li>Fiberglass stringer</li> <li>Teak and Ebony cabin sole, vinyl</li> <li>Sunbrella fabrics</li> <li>Vinylester barrier coat (hull)</li> </ul>",
                    "<strong>Disclaimer</strong><br>The Company offers the details of this vessel in good faith but cannot guarantee or warrant the accuracy of this information nor warrant the condition of the vessel. A buyer should instruct his agents, or his surveyors, to investigate such details as the buyer desires validated. This vessel is offered subject to prior sale, price change, or withdrawal without notice.",
                    "<strong>customContactInformation</strong><br><p style=\"text-align: center;\"><span style=\"font-size: 12pt; background-color: #ffffff; color: #000080;\"><strong>FOR ADDITIONAL INFORMATION AND A VIEWING APPOINTMENT</strong></span></p> <p style=\"text-align: center;\"><span style=\"font-size: 12pt; background-color: #ffffff; color: #000080;\"><strong>PLEASE CONTACT</strong></span></p> <p style=\"text-align: center;\"><span style=\"font-size: 12pt; background-color: #ffffff; color: #000080;\"><strong>Chris Burgess at 360 929-3351</strong></span></p> <p style=\"text-align: center;\"><span style=\"font-size: 12pt; background-color: #ffffff; color: #000080;\"><strong>chrisburgessfys@gmail.com</strong></span></p>"
                ],
