                "GeneralBoatDescription": [
                    "<p>Why wait for a new build! 2023 Ranger Tug, like new condition. 15hrs! Ranger tugs are great pacific northwest cruisers, they are economical at trawler speeds but with the ability to surpass 20knts. Fully equipped, Garmin electronic suite,  Yamaha 250 4 stroke, bow thruster, diesel heat, flat screen TV, fully functional galley, head with shower, solar panels, Fully transferrable warranty, why wait for a new build, start your cruise today! </p>"
                ],
